import React from "react"
import { Heading } from "grommet"
import CreateChat from "../createchat/createchat"
import "mainpage.css"

const TITLE = "Support The Fight Against COVID-19 While Sheltering In Place"
const DESC = `Do some good while talking face-to-face with your loved ones. This website provides a free videochat tool with some non-intrusive ads. 
100% of the ad revenue will be donated to the United Way Worldwide's COVID-19 Community Response and Recovery Fund. Stay safe, shelter in place, 
and help those on the frontlines of the coronavirus crisis.`
const MainPage = () => {
    return (
        <div className="container">
            <Heading level="1" alignSelf="center">
                {TITLE}
            </Heading>
            <CreateChat />
        </div>
    )
}

export default MainPage;
